import React, { useEffect, useState } from "react";
import SwaggerUI from "swagger-ui-react";
import "swagger-ui-react/swagger-ui.css";

function App() {
  const [swaggerSpec, setSwaggerSpec] = useState(null);

  useEffect(() => {
    fetch("http://localhost:5000/documentation")
      .then((response) => response.json())
      .then((data) => {
        console.log(data);  // Ausgabe des JSONs in der Konsole
        setSwaggerSpec(data);
      })
      .catch((error) => {
        console.error("Error fetching the Swagger documentation:", error);
      });
  }, []);

  return (
    <div className="App">
      {swaggerSpec ? <SwaggerUI spec={swaggerSpec} /> : <p>Loading...</p>}
    </div>
  );
}

export default App;
